import React from 'react';
import Todos from './components/Todos';

import './App.css';

function App() {
  return (
    <div className="App">

      state = {
        todos = [
          {
            id: 1,
            title: 'Take out the trash',
            completed: false
          },
          {
            id: 2,
            title: 'Make dinner',
            completed: false
          },
          {
            id: 3,
            title: 'Business Meeting',
            completed: false
          }
      ]
      }

      <h1>App</h1>
      <Todos />
    </div>
  );
}

export default App;
